ディアモ DIAMO  ディアモネイル (トップコート) 5ml   <BR><hr>
爪を保護しながらうるおいを与える、速乾性のあるトップコート<BR><BR>
天然ダイヤモンド（光沢成分）0.1ct配合のネイル（トップコート）で、<BR>ラメ成分との相乗効果で上品な輝きをあたえ、<BR>フォーマルから普段使いまで幅広く楽しめるトップコートジュエリー。<BR><BR>
ひと塗りするだけで、うるおい成分が爪を保護しながら、<BR>上品な輝きが指先から放たれます。<BR><BR>
・うるおい成分配合<BR>
 　アボガド油、ホホバ種子油、ブドウ種子油 



